import React from 'react';
import "../Asserts/Css/Pages/studyinsingapore.css";
import Header from '../Components/header';
import Footer from '../Components/footer';
import Navbar from '../Components/navbar';
import StudyAbroad from '../Components/StudyAbroad';
import YourNextStep from '../Components/YourNextStep';


const StudyinSingapore = ()=>{
    return (
         <div className='studyinsingaporepage'>
             <Header></Header>
             <Navbar></Navbar>
             <StudyAbroad></StudyAbroad>
           <h1>Study in Singapore</h1>
           <h2>EDUCATION IN SINGAPORE</h2>
           <p>Studying in Singapore, no doubt, will act as a platform to a brighter future. Driven by excellence, Institutions in Singapore offer a broad-based curriculum and global perspective to equip students with the relevant qualifications and training to succeed in a competitive environment. Hence educational institutions offer the latest and best in educational tools and technologies.</p>
           <p>As learning is lifelong, Institutions in Singapore offer a comprehensive range of training and enrichment programmes for executives, professionals and homemakers who place value on equipping themselves to achieve their aspirations. There are many who have chosen Singapore for their education and are happy that they made that decision, we believe they subscribe to what we believe in.</p>
           <p>Singapore is a compact island with tropical weather all year round. Singapore is a multi-cultural and multi-racial country; the four major languages are Malay, English, Mandarin and Tamil..</p>
           <h2>TOP REASONS TO STUDY IN SINGAPORE</h2>
           <p>Singapore offers a wide variety of accomodation to suit different needs and budgets.There are home stays,flats,landed property
</p>


       <YourNextStep></YourNextStep>
           <Footer></Footer>
              </div>
    )
}

export default StudyinSingapore ;
